import React, { useContext } from "react"
import { UserContext } from "../UserContext"

const CustomerPage = () => {
  const { customer } = useContext(UserContext)
  console.log(customer)
  return (
    <div>
      {customer && (
        <div>
          <p>{customer.name}</p>
          <p>{customer.organisation}</p>
        </div>
      )}
    </div>
  )
}

export default CustomerPage
